import React, { Component } from 'react'
import Home from './components/Home'
import Welcome from './components/Welcome'

class App extends Component {
  constructor(){
    super()
    this.state = {
      welcome: false,
      uuid: ''
    }
  }

  setWelcome = () => {
    this.setState({welcome: true})
  }

  setUuid = (userCode) => {
    this.setState({uuid: userCode})
  }

  render() {
    return (
      <div>
        { this.state.welcome ?  <Home setUuid={this.setUuid}/> : <Welcome setWelcome={this.setWelcome}/>}
      </div>
    )
  }
}

export default App

